    "#handle missing values using median/ mode approach\n",
    "  \n",
    "colSums(is.na(data))\n",
    "\n",
    "data$bedrooms[which(is.na(data$bedrooms))]<-median(data$bedrooms, na.rm = TRUE)\n",
    "data$beds[which(is.na(data$beds))]<-median(data$beds, na.rm = TRUE)\n",
    "\n",
    "data$minimum_minimum_nights[which(is.na(data$minimum_minimum_nights))]<-median(data$minimum_minimum_nights, na.rm = TRUE)\n",
    "data$maximum_minimum_nights[which(is.na(data$maximum_minimum_nights))]<-median(data$maximum_minimum_nights, na.rm = TRUE)\n",
    "data$minimum_maximum_nights[which(is.na(data$minimum_maximum_nights))]<-median(data$minimum_maximum_nights, na.rm = TRUE)\n",
    "data$maximum_maximum_nights[which(is.na(data$maximum_maximum_nights))]<-median(data$maximum_maximum_nights, na.rm = TRUE)\n",
    "\n",
    "data$minimum_nights_avg_ntm[which(is.na(data$minimum_nights_avg_ntm))]<-median(data$minimum_nights_avg_ntm, na.rm = TRUE)\n",
    "data$maximum_nights_avg_ntm[which(is.na(data$maximum_nights_avg_ntm))]<-median(data$maximum_nights_avg_ntm, na.rm = TRUE)\n",
    "\n",
    "\n",
    "data$review_scores_rating[which(is.na(data$review_scores_rating))]<-median(data$review_scores_rating, na.rm = TRUE)\n",
    "data$review_scores_accuracy[which(is.na(data$review_scores_accuracy))]<-median(data$review_scores_accuracy, na.rm = TRUE)\n",
    "data$review_scores_cleanliness[which(is.na(data$review_scores_cleanliness))]<-median(data$review_scores_cleanliness, na.rm = TRUE)\n",
    "data$review_scores_checkin[which(is.na(data$review_scores_checkin))]<-median(data$review_scores_checkin, na.rm = TRUE)\n",
    "data$review_scores_communication[which(is.na(data$review_scores_communication))]<-median(data$review_scores_communication, na.rm = TRUE)\n",
    "data$review_scores_location[which(is.na(data$review_scores_location))]<-median(data$review_scores_location, na.rm = TRUE)\n",
    "data$review_scores_value[which(is.na(data$review_scores_value))]<-median(data$review_scores_value, na.rm = TRUE)\n",
    "data$reviews_per_month[which(is.na(data$reviews_per_month))]<-median(data$reviews_per_month, na.rm = TRUE)"
