   "source": [
    "#Linear Reg\n",
    "\n",
    "install.packages(\"caret\",dependencies = TRUE)\n",
    "library(caret)\n",
    "\n",
    "install.packages(\"glmnet\",dependencies = TRUE)\n",
    "library(glmnet)\n",
    "\n",
    "install.packages(\"car\")\n",
    "library(car)\n",
    "\n",
    "library(ggplot2)\n",
    "\n",
    "set.seed(123)\n",
    "reg<-lm(price~., data = Traindata)\n",
    "\n",
    "summary(reg)\n",
    "\n",
    "set.seed(123)\n",
    "reg1<-step(reg, direction = \"backward\", trace = 0)\n",
    "\n",
    "summary(reg1)\n",
    "vif(reg1)"
   ]
