   "source": [
    "#cross validation method\n",
    "\n",
    "?train\n",
    "custom<-trainControl(method = \"repeatedcv\", number = 10, repeats = 5)\n",
    "cv<-train(price~., data = Traindata, method = \"lm\", trControl = custom)\n",
    "\n",
    "summary(cv)\n",
    "plot(varImp(cv, scale = TRUE))"
   ]
