   "source": [
    "#ridge\n",
    "\n",
    "set.seed(123)\n",
    "ridge<-train(price~., data = Traindata, method = \"glmnet\", trControl = custom,\n",
    "             tuneGrid = expand.grid(alpha = 0, lambda = seq(0.1, 1, length = 5)))\n",
    "\n",
    "ridge$results\n",
    "ridge$bestTune\n",
    "\n",
    "summary(ridge)\n",
    "\n",
    "plot(varImp(ridge, scale = TRUE))"
   ]
  },
