   "source": [
    "#lasso\n",
    "\n",
    "set.seed(123)\n",
    "lasso<-train(price~., data = Traindata, method = \"glmnet\", trControl = custom,\n",
    "             tuneGrid = expand.grid(alpha = 1, lambda = seq(0.1, 1, length = 5)))\n",
    "\n",
    "lasso$results\n",
    "lasso$bestTune\n",
    "\n",
    "summary(lasso)\n",
    "\n",
    "plot(varImp(lasso, scale = TRUE))"
   ]
  },
