   "source": [
    "#Predict the best model on Train data for testing purpose so that we can calculate RMSE\n",
    "\n",
    "p<-predict(lasso, Traindata)\n",
    "\n",
    "result<-data.frame(Actuals = Traindata$price, Predicted = p) \n",
    "\n",
    "install.packages(\"Metrics\")  \n",
    "library(Metrics)  \n",
    "  \n",
    "RMSE<-rmse(result$Actuals, result$Predicted)  \n",
    "RMSE"
   ]
  },
