    "#decision tree\n",
    "\n",
    "install.packages(\"rpart\")\n",
    "library(rpart)\n",
    "\n",
    "library(rpart.plot)\n",
    "library(rattle)\n",
    "\n",
    "?rpart\n",
    "tree<-rpart(price~.,data = Traindata)\n",
    "tree\n",
    "tree$splits  \n",
    "\n",
    "fancyRpartPlot(tree)\n"
   ]
  },
