   "source": [
    "#Predict the model on Train data for testing purpose\n",
    "\n",
    "p1<-predict(tree, Traindata)  \n",
    "\n",
    "result1<-data.frame(Actuals=Traindata$price,Predicted=p1)\n",
    "\n",
    "RMSE1<-rmse(result1$Actuals,result1$Predicted)\n",
    "RMSE1"
   ]
  },
